import { Alert, Button, InputAdornment, Snackbar, TextField } from "@mui/material"
import axios from "axios"
import React from "react"
import style from './CadastroVeicular.module.scss';


export const CadastroVeicular = ({ placa, setCadastroVeiculo, loginUser, setVeiculo }) => {
    const [info, setInfo] = React.useState({
        proprietario: '',
        documento: '',
        veiculo: '',
        modelo: '',
        chassi: '',
        placa: '',
        motor: '',
        fabricante: '',
        especieVeiculo: '',
        corVeiculo: '',
        combustivel: '',
        cilindrada: '',
        anoFabricacao: '',
        anoModelo: '',
        municipio: '',
        uf: '',
        tipoVeiculo: '',
        potencia: '',
        passageiroMax: '',
        cadastradoPor: {
            id: loginUser.id,
            nome: loginUser.nome
        },
    })

    const [noveic, setNoveic] = React.useState('');

    const [ op, setOp] = React.useState({
        op: false,
        tipo: 'info',
        Frase: ''
    })
    const fecharAviso = () => { setOp(a => ({...a, op: false}))}
    const avisoPositivo = () => {
        setOp(a => ({...a,
            op: true,
            tipo: 'success',
            frase: 'Cadastro do veículo realizado com sucesso!'
        }))
    }
    const avisoNegativo = () => {
        setOp(a => ({...a, 
            op: true,
            tipo: 'error',
            frase: 'O cadastro do veículo não foi realizado, verifique os dados e faça novamente!'
        }))
    }

    // const problemDisclaimer = () => {
    //     setOp(a => ({...a,
    //         op: true,
    //         tipo: 'warning ',
    //         frase: 'Ocorreu um problema tente novamente mais tarde!'
    //     }))
    // }
    const [ n, setN ] = React.useState(true)
 
    const Resposta = async () => {
        let consulta = await axios.get('http://localhost:3001/Servicos', { params: { placa } })
        // console.log(consulta.data)
        let { RESPOSTA } = consulta.data
        if (RESPOSTA.BASE_AGREGADOS.situacao === true) {
            setNoveic('Veículo não encontrado, gostaria de cadastrar novo veículo?')
        } else {
            let { BASE_AGREGADOS } = RESPOSTA
            setInfo(a => ({
                ...a,
                veiculo: BASE_AGREGADOS.Grupo_Modelo ? BASE_AGREGADOS.Grupo_Modelo : '',
                modelo: BASE_AGREGADOS.MarcaModelo ? BASE_AGREGADOS.MarcaModelo : '',
                chassi: BASE_AGREGADOS.chassi ? BASE_AGREGADOS.chassi : '',
                placa: BASE_AGREGADOS.Placa ? BASE_AGREGADOS.Placa : '',
                motor: BASE_AGREGADOS.Motor ? BASE_AGREGADOS.Motor: '',
                fabricante: BASE_AGREGADOS.Fabricante ? BASE_AGREGADOS.Fabricante : '',
                especieVeiculo: BASE_AGREGADOS.EspecieVeiculo ? BASE_AGREGADOS.EspecieVeiculo : '',
                corVeiculo: BASE_AGREGADOS.CorVeiculo ? BASE_AGREGADOS.CorVeiculo : '',
                combustivel: BASE_AGREGADOS.Combustivel ? BASE_AGREGADOS.Combustivel : '',
                cilindrada: BASE_AGREGADOS.Cilindradas ? BASE_AGREGADOS.Cilindradas : '',
                anoFabricacao: BASE_AGREGADOS.AnoFabricacao ? BASE_AGREGADOS.AnoFabricacao : '',
                anoModelo: BASE_AGREGADOS.AnoModelo ? BASE_AGREGADOS.AnoModelo : '',
                municipio: BASE_AGREGADOS.Municipio ? BASE_AGREGADOS.Municipio : '',
                uf: BASE_AGREGADOS.UF ? BASE_AGREGADOS.UF : '',
                tipoVeiculo: BASE_AGREGADOS.TipoVeiculo ? BASE_AGREGADOS.TipoVeiculo : '',
                potencia: BASE_AGREGADOS.Potencia ? BASE_AGREGADOS.Potencia : '',
                passageiroMax: BASE_AGREGADOS.QtdPax ? BASE_AGREGADOS.QtdPax : '',
            }))
        }
    }

    React.useEffect(() => {
        Resposta()
    }, [placa])

    const SalvarVeiculo = (e) => {
        e.preventDefault()
        axios.post('http://localhost:3001/Servicos/CadastrarVeiculo', { info })
            .then(res => {
                // console.log(res);
                // console.log(info);
                avisoPositivo()
                setCadastroVeiculo(true);
                setVeiculo(res);
            })
            .catch(err => {
                // console.log(err);
                avisoNegativo()
            })
    }

    const padrao = {
        minWidth: '30vw',
        margin: 1.5,
        "&:MuiInput-root.Mui-disabled": {
            background: "rgba(200, 100, 100, 1)",
            color: "rgba(200, 20, 20, 1)"
        }
    }


    return (
        <>
        <Snackbar
            open={op.op}
            autoHideDuration={6000}
            onClose={fecharAviso}
        >
            <Alert onClose={fecharAviso} severity={op.tipo} sx={{ width: '100%'}} >
                {op.frase}
            </Alert>
        </Snackbar>
            {info !== '' ?
                <form className={style.formulario} onSubmit={SalvarVeiculo}>
                    <TextField
                        variant="standard"
                        sx={padrao}
                        size='small'
                        label='Proprietário'
                        value={info.proprietario}
                        onChange={(e) => setInfo(a => ({ ...a, proprietario: e.target.value }))}
                        required
                    />
                    <TextField variant='standard' sx={padrao} size='small' label='CPF / CNPJ' value={info.documento} onChange={(e) => setInfo(a => ({ ...a, documento: e.target.value }))} required />
                    <TextField className={style.entrada} disabled={n} variant='standard' sx={padrao} size='small' label='Veículo' value={info.veiculo} onChange={(e) => setInfo(a => ({ ...a, veiculo: e.target.value }))} required />
                    <TextField className={style.entrada} disabled={n} variant='standard' sx={padrao} size='small' label='Modelo' value={info.modelo} onChange={(e) => setInfo(a => ({ ...a, modelo: e.target.value }))} required />
                    <TextField className={style.entrada} disabled={n} variant='standard' sx={padrao} size='small' label='Chassi' value={info.chassi} onChange={(e) => setInfo(a => ({ ...a, chassi: e.target.value }))} required />
                    <TextField className={style.entrada} disabled={n} variant='standard' sx={padrao} size='small' label='Placa' value={info.placa} onChange={(e) => setInfo(a => ({ ...a, placa: e.target.value }))} required />
                    <TextField className={style.entrada} disabled={n} variant='standard' sx={padrao} size='small' label='Motor' value={info.motor} onChange={(e) => setInfo(a => ({ ...a, motor: e.target.value }))} required />
